import { createIcon } from "../icon/createIcon";

export const SaveSolidIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="SaveSolidIcon">
    <path d="M9 0v1h1v.999L11 2v1h1v9H0V0h3v4h5V3h-.001V0H9zm1 6H2v4h8V9h-.001L10 6.5V6zM9 7v2H2.999L3 7h6zM6.999 0v3h-3L4 0h2.999z" />
  </svg>,
  "SaveSolid",
  "save solid"
);
